import React from "react";
import { Link } from "react-router-dom";

function DoubleRow (props) {


    return (
        <Link to='/ProjectDetails'>

        <div className='midddleRow'>

                    <div className='ThirdProject'>
                    <div>
                        <figure className='project-content'>
                          <p className="project-text">{props.name}</p>
                          <p className="project-year">{props.year}</p>
                          <img  src={props.img}  style={{borderRadius:24}} className="project"/>
                        </figure>
                      </div>
                    </div>

        </div>
        </Link>
    )
}

export default DoubleRow
